import React from 'react';
import './Home.css';

function Contact() {
  return (
    <div className="home">
      <section className="contact-section" style={{maxWidth: 600, margin: '48px auto', background: '#fff', borderRadius: '2rem', boxShadow: '0 2px 16px rgba(108,71,255,0.07)', padding: '48px 32px'}}>
        <h2 className="solution-title" style={{marginBottom: 24}}>Contact Us</h2>
        <div className="solution-desc" style={{marginBottom: 32}}>
          Have questions or want to get in touch? Fill out the form below and our team will get back to you soon.
        </div>
        <form className="contact-form" style={{display: 'flex', flexDirection: 'column', gap: 18}}>
          <input type="text" placeholder="Your Name" style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} />
          <input type="email" placeholder="Your Email" style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} />
          <textarea placeholder="Your Message" rows={5} style={{padding: '12px 16px', borderRadius: 8, border: '1px solid #e0e0e0', fontSize: 16}} />
          <button type="submit" className="pricing-btn" style={{marginTop: 12}}>Send Message</button>
        </form>
      </section>
    </div>
  );
}

export default Contact;
